import React from 'react';
import styled from 'styled-components';

function Header() {
    return (
        <div style={{ display: 'flex' }}>
            <Logo src="/image/ian_images/logo.jpeg" alt="logo" ></Logo>
            <Menu src="/image/ian_images/menu_01.jpeg" alt="menu"></Menu>
            <Menu src="/image/ian_images/menu_02.jpeg" alt="menu"></Menu>
            <Menu src="/image/ian_images/menu_03.jpeg" alt="menu"></Menu>
            <Menu src="/image/ian_images/menu_04.jpeg" alt="menu"></Menu>
            <Menu src="/image/ian_images/menu_05.jpeg" alt="menu"></Menu>
        </div>
    )
}

export default Header

const Logo = styled.img`
    margin-top: 10px;
    flex: 0.3;
    width: 40vw;
    justify-content: center;
`

const Menu = styled.img`
    margin-top: 10px;
    flex: 0.3
`
